# Configure this correctly. Otherwise, the prober will not succeed in getting OTA URLs!
# All Android fingerprints follow the following format:
#   <oem>/<product>/<device>:<android_version>/<build_tag>/<incremental>:user/release-keys
#   Nothing/Pong/Pong:15/AQ3A.240929.001/2505061805:user/release-keys

build_tag: "AQ3A.240929.001"       # Example: RKQ1.211119.001
incremental: "2505061805"     # Example: 2206131341
android_version: "15" # Only put in the major version number.
oem: "Nothing"             # The company that made your device (e.g. Samsung)
device: "Pong"          # The device code. May be same as model code.
model: "A065"           # The model code. (e.g. SM-T380)
product: "Pong"         # The product code. May be same as device code or model code.
